import Home from './Components/Home'
import Login from './Components/Login/Login'
import {BrowserRouter, Route, Routes} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
      <Route path="/" component={Home} />
         <Route path="/Login" component={ Login } />

      </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
